import { createTRPCProxyClient, httpBatchLink } from '@trpc/client';
import type { AppRouter } from '../src/router';
import * as dotenv from "dotenv"; // Make sure this path is correct

dotenv.config();

const client = createTRPCProxyClient<AppRouter>({
    links: [
        httpBatchLink({
            url: 'http://localhost:3000/trpc'
        })
    ]
});

async function testAnalyzeCV() {
    // @ts-ignore
    const result = await client.analyzeCV.mutate({
        jobDescriptionPdfBase64: '',
        cvPdfBase64: ''
    });

    // @ts-ignore
    console.log('AI Analysis:', result.analysis);
}

testAnalyzeCV();
